import '../styles/RideHistory.css';
import Navbar from "../components/Navigation_Bar/Navbar";

function RideHistory() 
{
    return (
        <div className='RideHistory'>
            <Navbar />
            <h1>Ride History</h1>
        </div>
    );
}

export default RideHistory;
